import { useEffect } from "react";
import {
  ButtonGroup,
  DropdownDivider,
  Image,
  OverlayTrigger,
  Tooltip,
} from "react-bootstrap";
import Button from "react-bootstrap/Button";
import Container from "react-bootstrap/Container";
import Form from "react-bootstrap/Form";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import NavDropdown from "react-bootstrap/NavDropdown";
import { useDispatch, useSelector } from "react-redux";
import { useNavigate } from "react-router-dom";
import { checkAuth, logout } from "../store/actions/authActions";
import { setCurrentUser } from "../store/slices/authSlice";
import "../index.css";
import { checkAuthFreeLance } from "../store/actions/authActionsFreeLance";

function NavScrollExample() {
  const { currentUser } = useSelector((state) => state.auth);

  const navigate = useNavigate();
  const dispatch = useDispatch();

  useEffect(() => {
    if (localStorage.getItem("tokens")) {
      dispatch(checkAuth());
      dispatch(checkAuthFreeLance());
    }
  }, []);

  const handleLogout = () => {
    logout();
    dispatch(setCurrentUser());
    navigate("/login");
  };

  return (
    <Navbar expand="lg" className="bg-body-tertiary">
      <Container fluid>
        <Navbar.Brand href="/">
          <a href="/">
            <img
              className="nav-logo"
              style={{
                width: "10em",
              }}
              src="https://ww2.freelogovectors.net/wp-content/uploads/2019/03/freelancerlogo.png"
              alt=""
            />
          </a>
        </Navbar.Brand>
        <Navbar.Toggle className="menu__burger" aria-controls="navbarScroll" />
        <Navbar.Collapse id="navbarScroll">
          <Nav
            className="burger-menu_bg"
            style={{
              maxHeight: "180px",
            }}
            navbarScroll
          >
            <Nav.Link
              className="nav-item"
              style={{
                fontWeight: "700",
                fontSize: "1.2em",
                marginLeft: "5em",
              }}
              onClick={() => navigate("/posts")}
            >
              Посты
            </Nav.Link>

            <NavDropdown
              style={{
                fontWeight: "600",
                fontSize: "1.2em",
                marginLeft: "2em",
              }}
              title="Регистрация"
              id="navbarScrollingDropdown"
            >
              <NavDropdown.Item
                style={{ fontWeight: "500" }}
                onClick={() => navigate("/register")}
              >
                Customer
              </NavDropdown.Item>
              <NavDropdown.Item
                style={{ fontWeight: "500" }}
                onClick={() => navigate("/register-freelancer")}
              >
                Freelancer
              </NavDropdown.Item>
              <DropdownDivider />
              <NavDropdown.Item
                style={{ fontWeight: "500" }}
                onClick={handleLogout}
              >
                Выйти
              </NavDropdown.Item>
            </NavDropdown>
            <NavDropdown
              style={{
                fontWeight: "600",
                fontSize: "1.2em",
                marginLeft: "2em",
              }}
              title="Войти"
              id="navbarScrollingDropdown"
            >
              <NavDropdown.Item
                style={{ fontWeight: "500" }}
                onClick={() => navigate("/login")}
              >
                Customer
              </NavDropdown.Item>
              <NavDropdown.Item
                style={{ fontWeight: "500" }}
                onClick={() => navigate("/login-freelancer")}
              >
                Freelancer
              </NavDropdown.Item>
              <DropdownDivider />
              <NavDropdown.Item
                style={{ fontWeight: "500" }}
                onClick={handleLogout}
              >
                Выйти
              </NavDropdown.Item>
            </NavDropdown>

            <Nav.Link href="#" disabled>
              <OverlayTrigger
                placement="bottom"
                overlay={
                  <Tooltip id="button-tooltip-2">Check out this avatar</Tooltip>
                }
              >
                {({ ref, ...triggerHandler }) => (
                  <Button
                    variant="light"
                    {...triggerHandler}
                    className="d-inline-flex align-items-center"
                  >
                    <Image
                      ref={ref}
                      roundedCircle
                      src="holder.js/20x20?text=J&bg=28a745&fg=FFF"
                    />
                    <span className="ms-1">Hover to see</span>
                  </Button>
                )}
              </OverlayTrigger>
            </Nav.Link>
          </Nav>
          <Form className="inp-search">
            <Form.Control
              type="search"
              placeholder="Поиск..."
              className="me-2"
              aria-label="Search"
            />
            <Button variant="outline-success" className="my-button">
              Найти
            </Button>
          </Form>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default NavScrollExample;
